import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


const text = 'Hello za warudo!'
//привыкать замыкать в скобки верстку
//нужен единственный родитель - корень для верстки
const elem = (
  <div>
    <h2>Текст: {text}</h2>
    <input type='text' />
    <button>Click</button>
  </div>
);


ReactDOM.render(
  elem,
  document.getElementById('root')
);
